import './header.css';
import { Link, useNavigate } from 'react-router-dom';
import { auth } from '../config/firebase';
import { useAuth } from '../config/firebase';


export const Header = () => {
    const currentUser = useAuth();
    const navigate = useNavigate();
  
    const Logout = () => {
     auth.signOut()
     .then(() => navigate('/'))
     .catch(error => console.log(error));
    }
   
    return (
    <header>

    </header>
  

  );
    }
